window.bookSummaryJSON = "<p>Tropes: Fated Mates; Star-Crossed Lovers; Marriage of Convenience</p> <p>He's finally free and he has three objectives:</p> <p>Claim Her.</p> <p>Steal Her.</p> <p>Sacrifice Her.</p> <p>Callum is the Prince of the North Sea and he's going to claim his vengeance on the descendant of the witch that stole his brother's life.</p> <p>Meghan is a research librarian in modern day Chicago. And he's the new maintenance guy in her apartment complex.</p> <p>He's been waiting over a thousand years.</p> <p>She's not going to let him drag her back to his cave, they're bound by prophecy and desire.</p> <p>A paranormal shifter romance based on Scottish water horse folklore and mythology.</p>"; 
